import { GET_SERVICES, ADD_SERVICES, DELETE_SERVICE } from './types';

export const getServices = () => {
    return{
        type: GET_SERVICES
    };
};

export const deleteService = (id) => {
    return{
        type: DELETE_SERVICE,
        payload: id
    };
};
